"""## **Calculo de Função. usando a função linear_regression para calcular a regressão linear.**"""

import statistics as st

#Função
def linear_regression(x,y):
  n = len(x)
  media_x=st.mean(x)
  media_y=st.mean(y)
  covariance=sum((x[i] - media_x)*(y[i] - media_y) for i in range(n))
  variance=sum((x[i] - media_x)** 2 for i in range(n))
  b1=covariance/variance
  b0=media_y - b1*media_x
  return b1,b0

#Dados
x = [4, 5, 6, 7, 8]
y = [14, 25, 26, 17, 8]

b1, b0 = linear_regression(x, y)

print('Coeficiente angular:' , b1)
print('Coeficiente Linear:' , b0)

intercept, slope = linear_regression(x,y)
print('O coeficiente de intercepto é:', intercept)
print('O coeficiente de inclinação é:', slope)

"""EXERCICIO REGRESSAO LINEAR HORAS DE ESTUDO VS NOTAS ALUNOS"""

import statistics as st

#Função
def linear_regression(Horas,Notas):
  n = len(Horas)
  media_Horas=st.mean(Horas)
  media_Notas=st.mean(Notas)
  covariance=sum((Horas[i] - media_Horas)*(Notas[i] - media_Notas) for i in range(n))
  variance=sum((Horas[i] - media_Horas)** 2 for i in range(n))
  b1=covariance/variance
  b0=media_Notas - b1*media_Horas
  return b1,b0

#Dados Horas de Estudo Notas
Horas = [3, 4, 5, 6, 7, 8, 9, 10]
Notas = [70, 75, 80, 85, 88, 90, 92, 95]

b1, b0 = linear_regression(Horas, Notas)
print('O coeficiente de intercepto é:', b1)
print('O coeficiente de inclinação é:', b0)